import java.util.*;

public class Bank {
  private Account masterAccount = new Account();
  public int maxAccountNumber = -1;
  public ArrayList<Account> listOfAccounts = new ArrayList<>();
  public int getNextAccountNumber(){
    addMaxAccount();
    return maxAccountNumber;
  }
  public void addMaxAccount(){
    maxAccountNumber += 1;
  }
  public void addAcount(Account account){
    listOfAccounts.add(account);
  }
  public Account findAccount(int accountNumber){
    return listOfAccounts.get(accountNumber);
  }
  public Account getMainAccount(){
    return masterAccount;
  }

}




public class Account{
    private Bank bank;
    private int accountNumber;
    private int balance;
    public Account(int balance){
      accountNumber = bank.getNextAccountNumber();
      balance = this.balance;
      bank.addAccount(this);
    }
    public void deposit(int n){
      balance += n;
    }
  public void withdraw(int n){
    balance -= n;
  }
  public void transferTo(int n, Account takingAccount){
    withdraw(n);
    takingAccount.deposit(n);
  }

}






public class SavingsAccount extends account{
  private double interestRate;
  public SavingsAccount(double interestRate){
    Super(100);
    interestRate = this.interestRate;
  }
  public int computeInterest(){
    return this.balance * this.interestRate;
  }
}
